def transcribe_dna_into_rna(dnaString):
    rnaString = ''

    for molecule in dnaString:
        if molecule == 'T':
            rnaString += 'U'
        else:
            rnaString += molecule

    return rnaString

result = transcribe_dna_into_rna('GATGGAACTTGACTACGTAAATT')
print(result)
print(result == 'GAUGGAACUUGACUACGUAAAUU')

result2 = transcribe_dna_into_rna('')
print(result2)